import { css } from './ImageGalleryItem.module.css'

function ImageGalleryItem({ webformatURL, tags }) {
  return (
    <li className={css.ImageGalleryItem}>
      <img
        src={webformatURL}
        alt={tags}
        className={css.ImageGalleryItemImage}
      />
    </li>
  )
}

export default ImageGalleryItem
